import React from 'react';

export default function Contact() {
  return (
    <main className="p-8 max-w-4xl mx-auto">
      <h1 className="text-2xl font-semibold mb-4">Contact</h1>
      <p>Contactez-nous pour des questions, commandes ou support.</p>
    </main>
  );
}
